#include <Servo.h>

// Inputs
const int btn = A1;
const int pot = A0;
const int pirPin = 4;
const int linePin = 8;

// Outputs
// LED
const int greenLED = 3;
// Other
const int buzzer = 2;
const int In1 = 10;
const int In2 = 12;
const int EnA = 11;
const int servoPin = 9;
Servo servo;

// Other pins
const int trigPin = 6;
const int echoPin = 5;

// Other variables
int pirState = LOW;
int pirVal = 0;

const int buzzerMin = 250;
const int buzzerMax = 1500;
int potVal = buzzerMin;

void setup() {
  Serial.begin(9600);
 
  // Inputs
  pinMode(btn, INPUT);
  pinMode(echoPin, INPUT);
  pinMode(pirPin, INPUT);
  pinMode(linePin, INPUT);
  pinMode(pot, INPUT);
 
  // Outputs
  pinMode(trigPin, OUTPUT);
  pinMode(In1, OUTPUT);
  pinMode(In2, OUTPUT);
  pinMode(EnA, OUTPUT);
  // Leds
  pinMode(buzzer, OUTPUT);
  pinMode(greenLED, OUTPUT);  

  analogWrite(EnA, 255);

  servo.attach(servoPin);
}

void loop() {
  // ----- Potentiometer ----- //
  int potIN = analogRead(pot);
  potVal = map(potIN, 0, 1023, buzzerMin, buzzerMax);
 
  // ----- Push Button ----- //
  int btnIN = digitalRead(btn);
  btnIN == 1 ? tone(buzzer, potVal) : noTone(buzzer);

  // ----- Sonic Distance Sensor ----- //
  UltraSonic();

  // ----- PIR Sensor ----- //
  PIR();

  // ----- Line Sensor ----- //
  int lineIN = digitalRead(linePin);
  if (lineIN == 1)
  {
    digitalWrite(In1, HIGH);
    digitalWrite(In2, LOW);
  }
  else
  {
    digitalWrite(In1, LOW);
    digitalWrite(In2, LOW);
  }
}

void UltraSonic()
{
  // Variables for duration of ping and the distance in cm
  long duration, cm;

  // The PING))) is triggered by a HIGH pulse of 2 or more microseconds.
  // Give a short LOW pulse beforehand to ensure a clean HIGH pulse:
 
  digitalWrite(trigPin, LOW);
  delayMicroseconds(2);
  digitalWrite(trigPin, HIGH);
  delayMicroseconds(5);
  digitalWrite(trigPin, LOW);

  // Read in our pulse
  duration = pulseIn(echoPin, HIGH);

  // convert the time into a distance
  cm = microsecondsToCentimeters(duration);

  digitalWrite(greenLED, cm < 10 ? HIGH : LOW);
}

void PIR()
{
  pirVal = digitalRead(pirPin);
  if (pirVal == HIGH)
  {
    if (pirState == LOW)
    {
      Serial.println("Motion detected");
      if (servo.read() != 180) servo.write(180);
      pirState = HIGH;
    }
  }
  else
  {
    if (pirState == HIGH)
    {
      Serial.println("Motion ended");
      if (servo.read() != 0) servo.write(0);
      pirState = LOW;
    }
  }
}

long microsecondsToCentimeters(long microseconds)
{
  return microseconds / 29 / 2;
}

