int main(int argc, char* argv[])
{
    registerGen(argc, argv, 1);
    int n=opt<int>("n");
    int v=(1<<29)-1;
    int manu=1e9;
    cout<<1<<endl<<n<<' '<<v<<endl;
    for (int i=0;i<n-1;++i) cout<<rnd.next(1,manu)<<' ';
    cout<<rnd.next(1,manu)<<endl;
    int p=opt<int>("p");
    bool sm=0;
    for (int i=0;i<n;++i)
    {
    	if (i==p-1) sm=1;
    	cout<<(1<<((i-sm)%29));
    	if (i<n-1) cout<<' ';
    	else cout<<endl;
	}
	int q=opt<int>("q");
	cout<<q<<endl;
	for (int i=0;i<q;++i)
	{
		if (i<q-1)
		{
			if (i%2==0) cout<<"1 "<<p<<' '<<(1<<((p-1)%29))<<endl;
			else cout<<"1 "<<p<<' '<<(1<<((p-2)%29))<<endl;
		}
		else cout<<"2 1 "<<n<<endl;
	}
}

#include <stdio.h>
#include <stdlib.h>

typedef struct{
     int a;
     int b;
} St;

void Fnc1( St s )
{
    s.a += 1;
    s.b += 2;

    printf("(f1) %d %d \n", s.a, s.b );
}

void Fnc2( St *p_s )
{
    p_s->a += 1;
    p_s->b += 2;

    printf("(f2) %d %d \n", p_s->a, p_s->b );
}

int main()
{

    St s_1;

    s_1.a = 1;
    s_1.b = 2;

    printf("(1) %d %d \n", s_1.a, s_1.b );

    Fnc1( s_1 );

    printf("(2) %d %d \n", s_1.a, s_1.b );

    Fnc2( &s_1 );

    printf("(3) %d %d \n", s_1.a, s_1.b );

    return 0;
}

