public class BlazeMover : MonoBehaviour
{
    [SerializeField] Animator anim; 
    [SerializeField] Transform groundCheck;
    [SerializeField] LayerMask ground;
    Gyroscope gyro;
    
    Vector3 movementDir; 
    bool moveForward;
    bool moveBackward;
    bool moveRight;
    bool moveLeft;
    float horizontalMove;
    float verticalMove;
    public float speed = 5f;

    void Start()
    {
        gyro = Input.gyro;
        gyro.enabled = true;
    }  

    public void PointerDownForward()
    {    
        moveForward = true;        
    }

    public void PointerUpForward()
    {
        moveForward = false;
        StopMoving();
    }

    public void PointerDownBackward()
    {   
        moveBackward = true;        
    }

    public void PointerUpBackward()
    {
        moveBackward = false;
        StopMoving();
    }

    public void PointerDownRight()
    {
        moveRight = true;
    }

    public void PointerUpRight()
    {
        moveRight = false;
        StopMoving();
    }

    public void PointerDownLeft()
    {
        moveLeft = true;
    }

    public void PointerUpLeft()
    {
        moveLeft = false;
        StopMoving();
    }


    private void Movement()
    {
        if (moveLeft)
        {
            horizontalMove = -speed; 
            anim.SetFloat("x", horizontalMove);
        }
        else if (moveRight)
        {  
            horizontalMove = speed; 
            anim.SetFloat("x", horizontalMove);
        }
        else
        {
            horizontalMove = 0;
        }

        if (moveForward)
        { 
            verticalMove = speed;
            anim.SetFloat("x", verticalMove);
        }
        else if (moveBackward)
        { 
            verticalMove = -speed;
            anim.SetFloat("x", verticalMove);
        }
        else
        {
            verticalMove = 0;
        }
    }

    private void Update()
    {
        Movement();
        if(IsGrounded() == true)
        {
           anim.SetBool("InAir", false); 
        }
        else
        {
           anim.SetBool("InAir", true);
        }

        Debug.DrawLine(groundCheck.position, groundCheck.position + Vector3.down, Color.red);
    }

    void StopMoving()
    {
        anim.SetFloat("x", 0);
        anim.SetFloat("y", 0);
        movementDir = new Vector3(0f,0f,0f);
        transform.Translate(movementDir, Space.World);
    }

    private void FixedUpdate()
    {   
        movementDir = new Vector3(horizontalMove, 0 , verticalMove);  
        movementDir.Normalize(); 
        transform.Translate(movementDir * speed * Time.deltaTime, Space.World);
         
        if(movementDir != Vector3.zero)
        {
            transform.forward = movementDir;
        }
    } 

    bool IsGrounded()
    {
        return Physics.CheckSphere(groundCheck.position, .3f, ground);
    } 
}

def bug2(start, goal, obstacles):
    position = start
    direction = (goal[0] - start[0], goal[1] - start[1])
    distance = (direction[0] ** 2 + direction[1] ** 2) ** 0.5

    while distance > 0:
        if position in obstacles:
            # Obstacle encountered, find a new direction
            new_direction = None
            min_distance = float('inf')

            # Check all possible directions
            for dx in [-1, 0, 1]:
                for dy in [-1, 0, 1]:
                    if dx == 0 and dy == 0:
                        continue

                    new_pos = (position[0] + dx, position[1] + dy)
                    if new_pos not in obstacles:
                        new_distance = ((goal[0] - new_pos[0]) ** 2 + (goal[1] - new_pos[1]) ** 2) ** 0.5
                        if new_distance < min_distance:
                            min_distance = new_distance
                            new_direction = (dx, dy)

            if new_direction is not None:
                direction = new_direction
        else:
            # Move towards the goal
            position = (position[0] + direction[0], position[1] + direction[1])

        distance = ((goal[0] - position[0]) ** 2 + (goal[1] - position[1]) ** 2) ** 0.5

    return position

