void draw_rectangle() {
	int width = 8;
	int heigth = 5;

	for (int y = 0; y < heigth; y++) {
		for (int x = 0; x < width; x++) {
			bool is_border1 = y == 0 || x ==0 ;
			bool is_border2 = y == heigth - 1 ||
				x == width - 1;
			if (is_border1 || is_border2) {

				cout << "$ ";

			}
			else {
				cout << "  ";
			}
		}
		cout << endl;
	}
}

