void guess_number() {
	int number_ai = rand() % 500 + 1;
	int number_human;

	cout << "   GUESS THE NUMBER\n";
	cout << " Я загадал число от 1 до 500, "
		 << "попробуй его угадать.\n";
	int raund = 0;
	do {
		cin >> number_human;
		raund++;
		if (number_human != number_ai) {
			if (number_ai > number_human) {
				cout << "Моё число больше ";
			}
			else {
				cout << "Моё число меньше ";
			}
			cout << number_human << endl;
		}
		else {
			cout << "Вы угадали за " << raund << " ходов.\n";
			break;
		}
	} while (number_human > 0);
	///
}

